svg.script:
var selectedLine = 6;
var finalAngle = "42";
function doMouseOver(evt) {
    for (i = 0;  i <= 99;  i++) {
        zero = "zero" + i.toString();
        one = "one" + i.toString();
        two = "two" + i.toString();
        three = "three" + i.toString();
        if (i == selectedLine) {
            document.getElementById(zero).setAttribute("visibility", "visible");
            document.getElementById(one).setAttribute("visibility", "visible");
            document.getElementById(two).setAttribute("visibility", "visible");
            document.getElementById(three).setAttribute("visibility", "visible");
        }
        else {
            document.getElementById(zero).setAttribute("visibility", "hidden");
            document.getElementById(one).setAttribute("visibility", "hidden");
            document.getElementById(two).setAttribute("visibility", "hidden");
            document.getElementById(three).setAttribute("visibility", "hidden");
        }
    }
    if (finalAngle.substr(finalAngle.length-2, 2) == "42") {
        document.getElementById("degrees").firstChild.nodeValue = "final angle: " + finalAngle + " degrees (maximum)";
    }
    else {
        document.getElementById("degrees").firstChild.nodeValue = "final angle: " + finalAngle + " degrees";
    }
    document.getElementById("rollover").firstChild.nodeValue = " ";
}
